public void UserCopyTest()
               {
                   AdministrationContractClient target = new AdministrationContractClient(); 
                   User user = new User();
                   string copyFromUserID;
                   copyFromUserID = "PIMS";
                   user.Code = "User100";
                   user.UserName = "User 100";
                   user.Clinician = new ProfessionalCarer();
                   user.Clinician.Code = "RAJR";
                   user.Password = "password123";
                   User ResultUser = target.UserCopy(user, copyFromUserID); 
                   System.Console.WriteLine(user.UsersOid);
                   System.Console.WriteLine(ResultUser.UsersOid);
                   System.Console.WriteLine(ResultUser.Clinician.ProfessionalCarerOid);
               }

